import React, { useState } from "react";
import styled from "styled-components";

const UserAlign = styled.div`
  position: absolute;
  background-color: #2c2c2c;

  width: calc(100% - 500px);
  height: 47px; //real size 56
  top: 155px;
  left: 200px;
  border-radius: 15px;

  color: white;
  text-align: left;
  font-family: Noto Sans KR;
  font-weight: 900px;
  font-size: 25px;
  line-height: 36px;
  padding-left: 46px;
  padding-top: 9px;

  @media (max-width: 1200px) {
    left: 120px;
    height: 35px;
    font-size: 20px;
    padding-top: 1px;
    padding-left: 20px;
  }

  @media (max-width: 1060px) {
    font-size: 15px;
    width: 100px;
    padding-top: 0px;
  }
  @media (max-width: 890px) {
    left: 70px;
  }
`;

const UserList = () => {
  const [users, setUsers] = useState([
    {
      id: 1,
      name: "서건희",
    },
    {
      id: 2,
      name: "킹남대",
    },
  ]);

  return (
    <div>
      {users.map((user) => (
        <UserAlign>{user}</UserAlign>
      ))}
    </div>
  );
};

export default UserList;
